  `CURRENCY_CD` varchar(5) default NULL COMMENT '币种CURRENCY_CD:人民币CNY',
  `EXCHANGE_RATE` decimal(8,6) default NULL COMMENT '汇率默认1',
  `LOAN_TERM` int(11) default NULL COMMENT '借款期限',
